import React from 'react';

const LoginPage = () => {
  return (
    <div className="flex h-screen bg-[#fef6d8]">
      {/* This is your title container */}
      <div className="flex flex-col justify-center w-1/2 pl-8">
        <h1 className="text-left text-5xl font-bold mb-4">Volunteer Management System</h1>
      </div>

      {/* This is your form container */}
      <div className="flex flex-col justify-center w-1/2 pr-8">
        <form className="bg-white p-10 rounded-2xl shadow-2xl">

          {/* Email input with the yellow highlight */}
          <div className="relative mb-6">
            <div className="absolute inset-x-0 bottom-0 h-1 bg-[#fcd137]"></div>
            <input className="w-full px-4 py-3 border rounded-xl bg-transparent relative z-10" type="email" placeholder="Email" />
          </div>

          {/* Password input with the yellow highlight */}
          <div className="relative mb-6">
            <div className="absolute inset-x-0 bottom-0 h-1 bg-[#fcd137]"></div>
            <input className="w-full px-4 py-3 border rounded-xl bg-transparent relative z-10" type="password" placeholder="Password" />
          </div>

          {/* Buttons */}
          <div className="flex justify-between mb-4">
            <button className="w-1/2 mr-2 bg-[#fcd137] hover:bg-[#e2c024] text-black font-bold py-2 px-4 rounded">Log In</button>
            <button className="w-1/2 ml-2 bg-[#fcd137] hover:bg-[#e2c024] text-black font-bold py-2 px-4 rounded">Sign Up</button>
          </div>

          {/* Forgot Password Link */}
          <a className="block text-center text-slate-400 hover:text-slate-500" href="#">Forgot Password?</a>
        </form>
      </div>
    </div>
  );
};

export default LoginPage;
